import React from "react";
import "../../components/homeContent/about.css";

function About() {
  return (
    <div className="aboutWrapper">
  <div className="imgbox">
    <img src="../final.jpg" className="womenimg" alt="womenimg" />
  </div>
  <div className="contentDiv">
    <h2 className="heading">About us</h2>
    <p className="about">
      Valmiki is a comprehensive, free platform offering a wide range of college courses, along with an integrated coding platform for hands-on practice. Explore limitless learning opportunities without any cost.
    </p>
  </div>
</div>

  );
}

export default About;
